import CheckPassValidate from './CheckPassValidate';

/**
 * 確認パスワードのコンポーネント
 *
 * @param {string} passState（パスワード入力値）
 * @param {string, function} checkPassState（確認パスワード入力値／更新関数）
 * @param {boolean} checkPassErrorFlag（確認パスワードエラーフラグ／更新関数）
 */
const SignUpCheckPass = ({ passState, checkPassState, checkPassErrorFlag }) => {
  return (
    <>
      <CheckPassValidate
        passState={passState}
        checkPassState={checkPassState}
        checkPassErrorFlag={checkPassErrorFlag}
        placeholder={'確認パスワード'}
      />
    </>
  );
};
export default SignUpCheckPass;
